import React from "react";
import styled, { ThemeProvider } from "styled-components";
import { Transition } from "arclight-react";

const PickCard = styled.div`
  position: relative;
  width: 100%;
  & img {
    position: absolute;
    width: 100%;
    top: 0;
    left: 0;
  }
`;

export default class _ extends React.Component {
  render() {
    return (
      <ThemeProvider theme={{}}>
        <Transition>
          <PickCard>
            <img src={require("./img/yone.jpg")} />
            <img src={require("../../../../config/assests/border.png")} />
          </PickCard>
        </Transition>
      </ThemeProvider>
    );
  }
}
